import React from 'react';
import './AchievementsSection.css';

const AchievementsSection = () => {
  return (
    <section>
      <h1>Achievements of Team RASPBerry</h1>
      <p>Project Kyan is thrilled to share its participation in numerous events...</p>
    </section>
  );
};

export default AchievementsSection;
